import React from 'react';
import Header from '../components/HeaderContact';
import Contact from '../components/Contact';
import Bottom from '../components/BottomContact';


function ContactUs() {
  return (
    <>
      <Header />
      <Contact />
      <Bottom />
    </>

  );
}

export default ContactUs;
